when(entry.duration) { totalTime += entry.duration; }
after { print("Total Time:", totalTime/1000, "seconds"); }
rewind();
when(entry.duration) {
  entry.prop = entry.duration * 100 / totalTime;
  if(entry.prop > 9) {
    print(entry.prop.toFixed(2) + "%", entry.desc);
  }
